import React from 'react'
import {useNavigate}  from 'react-router-dom'
function Home() {
    const navigate = useNavigate()
  return (
    <div className='flex justify-center items-center h-screen w-screen'>
      <div>
      <p className='text-red-400 text-3xl'>Click here to login</p>
        <button onClick={()=>{
            navigate('login')
        }} className='p-3 m-2 text-white bg-gray-500 rounded'>login</button>

<p className='text-red-400 mt-4 text-6xl'>Visit store</p>

        <button onClick={()=>{
            navigate('store')
        }} className='p-3 m-2 text-white bg-gray-500 rounded'>Store</button> 
      </div>
       
    </div>
  )
}

export default Home
